from math import factorial as f, log, floor
B= {}
def b(n,x):
    if (n,x) in B: return B[(n,x)]
    if n<=1: B[(n,x)] = int(x>=0)
    else: B[(n,x)]=sum([b(i,x-1)*b(n-1-i,x-1)*f(n-1)//f(i)//f(n-1-i) for i in range(n)])
    return B[(n,x)]
for n in range(1,51): print(b(n,floor(log(n,2))))
